      SELECT DISTINCT * FROM tab2 (FORMAT parquet) WHERE NULL <= - ( - col1 ) * + + col2 + - 5 + + CAST ( NULL AS INTEGER ) + + CAST ( + col2 AS INTEGER ) / - col0 + col0 * + - col0;
  - name: tab2

outputs:
  - name: q5665.out
    data: |
